import App, {Container} from 'next/app'
import Page from '../components/Page'

export default class MyApp extends App {
    render() {

        const {Component, pagePops} = this.props;

        return ( 
            <Page>
                <Component {...pagePops}/>
            </Page>
       
        )

    }
}
